// App.js
import React, { lazy, Suspense, useState, useEffect } from 'react';
import { BrowserRouter as Router, Route, Routes, useNavigate } from 'react-router-dom';
import { ClerkProvider, SignedIn, SignedOut, useSession } from '@clerk/clerk-react';
import { dark } from "@clerk/themes";
import Layout from './components/common/Layout';
import { useSupabaseClient } from './utils/auth';

const HomePage = lazy(() => import('./pages/HomePage'));
const SignupPage = lazy(() => import('./pages/SignupPage'));
const LoginPage = lazy(() => import('./pages/LoginPage'));
const ProfilePage = lazy(() => import('./pages/ProfilePage'));
const WatchlistPage = lazy(() => import('./pages/WatchlistPage'));
const MediaPage = lazy(() => import('./pages/MediaPage'));
const PostSignUp = lazy(() => import('./pages/PostSignUp'));

const clerkPubKey = 'pk_test_ZnVubnktdW5pY29ybi03OS5jbGVyay5hY2NvdW50cy5kZXYk';

function App() {
  const [showLogin, setShowLogin] = useState(false);
  const [showSignup, setShowSignup] = useState(false);
  const supabase = useSupabaseClient();
  const { session } = useSession();

  useEffect(() => {
    const syncSupabaseAuth = async () => {
      if (session) {
        const token = await session.getToken({ template: 'supabase' });
        await supabase.auth.setAuth(token);
      }
    };
    syncSupabaseAuth();
  }, [session, supabase]);

  const toggleLogin = () => {
    setShowLogin((prev) => !prev);
    if (showSignup) setShowSignup(false);
  };

  const toggleSignup = () => {
    setShowSignup((prev) => !prev);
    if (showLogin) setShowLogin(false);
  };

  return (
    <ClerkProvider 
      appearance={{ baseTheme: dark }} 
      publishableKey={clerkPubKey}
    >
      <Router>
        <div className="App">
          <Suspense fallback={<div>Loading...</div>}>
            <Routes>
              <Route 
                path="/" 
                element={
                  <Layout 
                    showLogin={showLogin} 
                    showSignup={showSignup} 
                    toggleLogin={toggleLogin} 
                    toggleSignup={toggleSignup} 
                  />
                }
              >
                <Route 
                  index 
                  element={
                    <HomePage 
                      showLogin={showLogin} 
                      showSignup={showSignup} 
                      toggleLogin={toggleLogin} 
                      toggleSignup={toggleSignup} 
                    />
                  } 
                />
                <Route path="signup" element={<SignupPage />} />
                <Route path="profile" element={
                  <SignedIn>
                    <ProfilePage />
                  </SignedIn>
                } />
                <Route path="lists" element={<WatchlistPage />} />
                <Route path="/list/:username/:watchlistName" element={<MediaPage />} />
              </Route>
              <Route path="/login" element={
                <SignedOut>
                  <LoginPage />
                </SignedOut>
              } />
              <Route path="/signup" element={
                <SignedOut>
                  <SignupPage />
                </SignedOut>
              } />
            </Routes>
          </Suspense>
        </div>
      </Router>
    </ClerkProvider>
  );
}

export default App;
